import React from "react";

function App() {
  const func = () => {
    console.log("hello world");
  };

  const counter = 0;

  return (
    <div>
      <h1>Hello world!</h1>
      <button onClick={counter++ && func()}>counter</button>
    </div>
  );
}

export default App;
